import React from "react";
import "./Blog.css";

deletePost=(id)=>{
    console.log(id);
    props.deletePost(id);
}
export default function Blog(props){

    return(
        <div>
            <>
                <p>{props.title}</p>
                <p>{props.content}</p>
                <p>{props.id}</p>
            </>
            <button onClick={deletePost(props.id)}>X</button>
        </div>
    );
}
